const Home = () => {
    return (
        <>
            <section>
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-10 mx-auto">

                        </div>
                    </div>
                </div>
            </section>
            <h1>This is home page</h1>
        </>
    );
}

export default Home;
